var where = 0
if (window.location.hash) {
    var i, n
    var s = window.location.hash.substr(1)
    if(s.length < 11) {
        where = parseInt(s);
    } else {
        n = s.length
        for(i=0; i<all.length; ++i) {
            if(all[i].id.substr(0, n) == s) {
                where = i
                break
            }
        }
    }
}
$(document).keypress(function(e){
  if(e.keyCode == 112) {
    // 'p' for previous
    where -= 1
  } else {
    where += 1
  }
  if(where < 0) {
    where = 0
  }
  if(where >= all.length) {
    where = all.length - 1
  }
  showWhere()
})
function showWhere() {
  var station = all[where]
  var url = station.id + ".svg"
  var frag = url.substr(0, url.indexOf('.'))
  window.location.hash = '#'+frag
  $('#plot').attr('src', url)
  map.panTo([station.latitude, station.longitude])
}
$(function() {
  map = L.map('map', {
      layers: MQ.mapLayer(),
      center: [ 40.731701, -73.993411 ],
      zoom: 9
  });

  showWhere()
})
